import React from "react";
import { Link } from "react-router-dom"; 
 const homepage = () => {
   return (
     <div>
       <div className="navbar">
          <div className="logo">Shopio</div>
           <ul className="nav-links">
              <Link to="/">Home</Link>
              <Link to="/about">About</Link>
              <Link to="/shop">Shop</Link>
           </ul>
        </div>

     </div>
   )
 }

 export default homepage
